class Poisson3D_4BilinearForm : public dolfin::Form
{
public:

  Poisson3D_4BilinearForm(dolfin::FunctionSpace& V0, dolfin::FunctionSpace& V1) : dolfin::Form()
  {
    std::tr1::shared_ptr<dolfin::FunctionSpace> _V0(&V0, dolfin::NoDeleter<dolfin::FunctionSpace>());
    function_spaces.push_back(_V0);
    std::tr1::shared_ptr<dolfin::FunctionSpace> _V1(&V1, dolfin::NoDeleter<dolfin::FunctionSpace>());
    function_spaces.push_back(_V1);

    _ufc_form = new UFC_Poisson3D_4BilinearForm();

    check();
  }

  Poisson3D_4BilinearForm(std::tr1::shared_ptr<dolfin::FunctionSpace> V0, std::tr1::shared_ptr<dolfin::FunctionSpace> V1) : dolfin::Form()
  {
    function_spaces.push_back(V0);
    function_spaces.push_back(V1);

    _ufc_form = new UFC_Poisson3D_4BilinearForm();

    check();
  }

};

class Poisson3D_4LinearForm : public dolfin::Form
{
public:

  Poisson3D_4LinearForm(dolfin::FunctionSpace& V0, dolfin::Function& v0) : dolfin::Form()
  {
    std::tr1::shared_ptr<dolfin::FunctionSpace> _V0(&V0, dolfin::NoDeleter<dolfin::FunctionSpace>());
    function_spaces.push_back(_V0);

    std::tr1::shared_ptr<dolfin::Function> _v0(&v0, dolfin::NoDeleter<dolfin::Function>());
    coefficients.push_back(_v0);

    _ufc_form = new UFC_Poisson3D_4LinearForm();

    check();
  }

  Poisson3D_4LinearForm(std::tr1::shared_ptr<dolfin::FunctionSpace> V0, std::tr1::shared_ptr<dolfin::Function> v0) : dolfin::Form()
  {
    function_spaces.push_back(V0);

    coefficients.push_back(v0);

    _ufc_form = new UFC_Poisson3D_4LinearForm();

    check();
  }

};

